import React from 'react';
import CircularProgress from '@material-ui/core/CircularProgress';

const LoadingLocal = props => {
    const { size } = props;
    return (
        <CircularProgress  
            size={size}
            color="secondary"
        />
    );
};
export default LoadingLocal;
